import React, { useEffect, useState } from "react";
import { useSearchParams, useNavigate } from "react-router-dom";
import Header from "../components/Header";
import Footer from "../components/Footer";
import { supabase } from "../services/supabase";

const PaymentPage = () => {
  const [searchParams] = useSearchParams();
  const [processing, setProcessing] = useState(true);
  const navigate = useNavigate();

  const orderNumber = searchParams.get("order");
  const amount = searchParams.get("amount");

  useEffect(() => {
    setTimeout(() => {
      markAsPaid();
    }, 2000);
  }, []);

  const markAsPaid = async () => {
    const { error } = await supabase
      .from("orders")
      .update({
        payment_status: "paid",
        status: "pending",
      })
      .eq("order_number", orderNumber);

    if (!error) {
      setProcessing(false);
    }
  };

  const styles = {
    page: {
      minHeight: "100vh",
      display: "flex",
      flexDirection: "column",
      background: "linear-gradient(135deg, #e8f5e9 0%, #f0e8f8 100%)",
    },
    container: {
      maxWidth: "600px",
      margin: "5rem auto",
      padding: "0 2rem",
      flexGrow: 1,
      textAlign: "center",
    },
    card: {
      background: "white",
      padding: "3rem",
      borderRadius: "16px",
      boxShadow: "0 8px 24px rgba(0,0,0,0.1)",
    },
    spinner: {
      width: "60px",
      height: "60px",
      border: "6px solid #f0f0f0",
      borderTop: "6px solid #6B4A8A",
      borderRadius: "50%",
      animation: "spin 1s linear infinite",
      margin: "0 auto 2rem",
    },
    successIcon: {
      fontSize: "5rem",
      marginBottom: "1rem",
    },
    title: {
      fontSize: "2.5rem",
      color: "#27ae60",
      marginBottom: "1rem",
      fontWeight: "700",
    },
    processingTitle: {
      fontSize: "2rem",
      color: "#5A3A79",
      marginBottom: "1rem",
    },
    text: {
      fontSize: "1.1rem",
      color: "#6b7e85",
      marginBottom: "0.5rem",
    },
    orderNumber: {
      fontSize: "1.3rem",
      fontWeight: "700",
      color: "#6B4A8A",
      marginTop: "1rem",
      marginBottom: "2rem",
    },
    infoBox: {
      background: "#e8f5e9",
      padding: "1.5rem",
      borderRadius: "8px",
      borderLeft: "4px solid #27ae60",
      marginTop: "2rem",
      textAlign: "left",
    },
    infoTitle: {
      fontWeight: "700",
      color: "#27ae60",
      marginBottom: "0.5rem",
    },
    infoText: {
      fontSize: "0.95rem",
      color: "#404c50",
      lineHeight: "1.6",
    },
    button: {
      background: "#50ADB5",
      color: "white",
      border: "none",
      padding: "1rem 2.5rem",
      borderRadius: "30px",
      fontSize: "1.1rem",
      fontWeight: "700",
      cursor: "pointer",
      marginTop: "2rem",
    },
  };

  return (
    <div style={styles.page}>
      <Header />

      <div style={styles.container}>
        <div style={styles.card}>
          {processing ? (
            <>
              <div style={styles.spinner}></div>
              <h1 style={styles.processingTitle}>Processing Payment...</h1>
              <p style={styles.text}>Please wait</p>
            </>
          ) : (
            <>
              <div style={styles.successIcon}>✅</div>
              <h1 style={styles.title}>PAID!</h1>
              <p style={styles.text}>Payment confirmed</p>
              <div style={styles.orderNumber}>Order #{orderNumber}</div>
              <p style={styles.text}>Amount: ${amount}</p>

              <div style={styles.infoBox}>
                <div style={styles.infoTitle}>✓ What's next?</div>
                <div style={styles.infoText}>
                  1. You'll receive order confirmation email
                  <br />
                  2. Our team humanizes your content
                  <br />
                  3. You'll be notified when ready (48-96 hours)
                  <br />
                  4. Download from "My Orders"
                </div>
              </div>

              <button
                style={styles.button}
                onClick={() => navigate("/my-orders")}
              >
                View My Orders
              </button>
            </>
          )}
        </div>
      </div>

      <Footer />

      <style>{`
        @keyframes spin {
          0% { transform: rotate(0deg); }
          100% { transform: rotate(360deg); }
        }
      `}</style>
    </div>
  );
};

export default PaymentPage;
